import Layout from "@/layout";
import { Avatar, Box, Flex } from "@chakra-ui/react";
import Head from "next/head";

export default function Profile() {
  return (
    <Layout>
      <Head>
        <title>Profile</title>
      </Head>

      <Flex justifyContent="center" bg="tomato" h="100px" w="100%">
        <Avatar size="lg" />
      </Flex>
    </Layout>
  );
}
